export default class App extends Component {
   constructor(){
     super()
     this.state = {
       display1:"block"

     }
     this.handlechange1 = this.handlechange1.bind(this)

   }
     handlechange1(e){

      const div = document.querySelector("div");

        e.div.target = this.setState({
          display1:"none"
        })

     }







  render() {

    return (
      <div>

        <div style={{display:this.state.display1}} onClick={this.handlechange1}> <h1>hello 1</h1> </div>
        <div style={{display:this.state.display1}} onClick={this.handlechange1}> <h1>hello 2</h1> </div>
        <div style={{display:this.state.display1}} onClick={this.handlechange1}> <h1>hello 3</h1> </div>
        <div style={{display:this.state.display1}} onClick={this.handlechange1}> <h1>hello 4</h1> </div>



      </div>
    )
  }
}
